tags.expression:
toStr(minutesBetween(timestampOf({[.]mode}),now()))
+ ' mins. ' 
+ toStr(
	round(
		abs( //remove calculated minutes from seconds between (get decimal remainder)
			round(secondsBetween(timestampOf({[.]mode}),now())/60) - secondsBetween(timestampOf({[.]mode}),now())/60
			) *60 //Convert back to minutes
		)
	) 
+ ' secs.'

//if line is on break or lunch, override calculation to break or lunch
if({[.]onBreak} || {[.]onLunch},
	// Stuff happens here 
	if({[.]onBreak},
		99001, //lunch state
		99002  //break state
	)
	,
	// not on break or lunch
	if({[.]../config/hasCells},
		// hasCells
		runscript('mes.oee.state.getLineState', 
			0, 
			{TagName}, 
			{[.]line}, 
			{[.]../config/LineConfigDS}, 
			{[.]../config/LineCellsConfigDS},
			{[.]../machineInput/state})
	,
		//Does Not Have Cells
		{[.]../machineInput/state} 
	)
)

